import React from 'react'
import styled from 'styled-components'

import {SideBarStyled} from '../sidebar'
import {TextBlack} from '../text/index'
import AvatarSquareCard from '../cards/AvatarSquareCard'

const InfoBarStyled = styled(SideBarStyled)`
    width : 225px;

`
//height : 595px
//width : 225px 
// margin-left : 1128px
export  function InfoSideBar() {
    return (
        <div>
            <InfoBarStyled>
                <div className="profile">
                    <TextBlack fontSize="16px">Profile</TextBlack>
                    <AvatarSquareCard/>
                </div>
            </InfoBarStyled>
        </div>
    )
}
